(73775, x, x, 'The Underhold has been breached! Get to the Shredders, and tear these interlopers to pieces!', 14, 0, 100, 53, 0, 0, 0, 'War Master Kragg to Player'),
(73775, x, x, 'I have a limitless supply of Kor''kron at my command you fools! Surrender now and I will give you a quick death.', 14, 0, 100, 5, 0, 0, 0, 'War Master Kragg to Player'),
(73775, x, x, 'Iron Sentinels! To me!', 14, 0, 100, 0, 0, 0, 0, 'War Master Kragg to 0'),
(72694, x, x, 'Goro''dan! You''re on deck!', 14, 0, 100, 0, 0, 0, 0, 'Siegecrafter Blackfuse to Player'),
(72694, x, x, 'Alright, Shanna. You''re up.', 14, 0, 100, 0, 0, 0, 0, 'Siegecrafter Blackfuse to Player'),
(72694, x, x, 'Looks like I''m in the market for a new assistant.', 14, 0, 100, 0, 0, 0, 0, 'Siegecrafter Blackfuse to Player'),
