(72694, x, x, 'The SD-5 Automated Shredder defense unit. A labor of love.', 14, 0, 100, 0, 0, 0, 0, 'Siegecrafter Blackfuse to Automated Shredder'),
(72694, x, x, 'You son of a...', 14, 0, 100, 0, 0, 38450, 0, 'Siegecrafter Blackfuse to Siegecrafter Blackfuse'),
(72694, x, x, 'Another satisfied customer.', 14, 0, 100, 0, 0, 38464, 0, 'Siegecrafter Blackfuse to Automated Shredder'),
(72694, x, x, 'That''s for the Juggernaut.', 14, 0, 100, 0, 0, 38463, 0, 'Siegecrafter Blackfuse to Shockwave Missile Caster Stalker'),
(72694, x, x, 'You son of a...', 14, 0, 100, 0, 0, 38464, 0, 'Siegecrafter Blackfuse to Siegecrafter Blackfuse'),
(72964, x, x, 'You''re Screwed!', 14, 0, 100, 0, 0, 0, 0, 'Goro''dan to 0'),
(71520, x, x, 'Unfinished weapons begin to roll out on the assembly line.', 41, 0, 100, 0, 0, 38446, 0, 'Siege Engineer Helper Bunny to 0'),
